import React from "react";
import IInfos from "../../types";
import Item from "./Item";

export default function Lista({names}: {names: IInfos[]}){
    return(
        <div className="ListWrapper">
            <table> 
                <tr>
                    <th>Model</th>
                    <th>Licente Plate</th>
                    <th>Entrada</th>
                </tr>
                <tr>
                {names.map((item, index) => (
                    <Item
                    index={index}
                    {...item}
                    />
                ))}
                </tr>
               </table>
        </div>

    )
}
